I was lucky enough to test the Skydio 2 a few weeks ago and I'm very impressed. It has allowed me to get shots I would otherwise need a two operator Setup to achieve. The obstacle avoidance is cinematic, fluid and makes this aircraft a must have tool for filmmakers. This video was created with the Skydio 2.

The drone you've been waiting for is here. Reserve now at skydio.com

